import React, { Component } from 'react';

const NavBar = (props) => {
    return (
        <nav className="navbar navbar-light bg-light">
            <a className="navbar-brand" href="#">
                Navbar &nbsp;
                <span className='badge badge-secondary badge-pill'> {props.totalCounters}</span>
            </a>
        </nav>
    );
};

export default NavBar;
